import React, { Component } from 'react';

class Wrapper extends Component {
  render() {
    return(
      <div id="wrapper">
        <HeaderWrapper />
        <Splash />
        <Page />
      </div>
    );
  }
}

class HeaderWrapper extends Component {
  render() {
    return(
      <div id="header-wrapper">
        <div id="header">
          <div id="logo">
            <h1><a href="#">茶包</a></h1>
          </div>
        </div>
      </div>
    ) ;
  }
}

class Splash extends Component {
  render() {
    return(
      <div id="splash">
        <img src="dog.png" style={ {width: 259, height: 224} } />
      </div>
    ) ;
  }
}

class Page extends Component {
  render() {
    return(
      <div id="page">
        <Content />
        <SideBar />
        <div style={{clear: "both"}}>&nbsp;</div>
      </div>
    ) ;
  }
}

class Content extends Component {
  render() {
    return(
      <div id="content">
          <div className="contentbg">
            <div className="post">
              <h2 className="title"><a href="#">Welcome to 茶包的網頁</a></h2>
              <div className="entry">
                <p>我是茶包,我是一隻法鬥</p>
              </div>
            </div>
            <div className="post">
              <h2 className="title"><a href="#">關於法鬥</a></h2>
              <div className="entry">
                <p>法鬥是最可愛的品種</p>
              </div>
            </div>
            <div className="post">
              <h2 className="title"><a href="#">茶包的夢想</a></h2>
              <div className="entry">
                <p>當爐石選手</p>
              </div>
            </div>
          </div>
          <div style={{clear: "both"}}>&nbsp;</div>
      </div>
    ) ;
  }
}

class SideBar extends Component {
  render() {
    return(
      <div id="sidebar-bg">
          <div id="sidebar">
            <ul>
              <li>
                <h2>茶包的清單</h2>
                <p>茶包的.....</p>
              </li>
              <li>
                <h2>狗的種類</h2>
                <ul>
                  <li><a href="#">可愛的法鬥</a></li>
                  <li><a href="#">帥氣的法鬥</a></li>
                  <li><a href="#">優秀的法鬥</a></li>
                </ul>
              </li>
            </ul>
          </div>
      </div>
    ) ;
  }
}
export default Wrapper;
